import {Service} from './Service'
export function login(data) {
  return Service({
    url: '/user/login/',
    method: 'post',
    data: data
  })
}
export function register(data) {
  return Service({
    url: '/user/regist/ ',
    method: 'post',
    data: data
  })
}
// 账号管理 导入
export function addNewAndroidPlugin(data) {
  return Service({
    url: '/account/download/',
    method: 'post',
    data: data
  })
}
